import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp, faGithub } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope, faHouse } from '@fortawesome/free-solid-svg-icons';
import '../Css/Portofoliosaya.css';
import Tentangsaya from '../Assets/Tentangsaya.png';



const Header = () => {

  return (
    <div className="tentangsaya pop py-5">
        <Container>
            <h1 className='fwb text-center'><span className='text-yellow'>Portofolio</span> Saya</h1>

            <div className='cover mt-5 pop'>
                <div className='tahun'>
                    <p className='text-purple fwb'>React JS</p>
                </div>
                <div className='konten-porto text-purple'>
                    <ul>
                        <li>Menjadi Fullstack Developer menggunakan Framework Laravel</li>
                        <li>Membuat tampilan Website pengguna</li>
                        <li>Mengatur output data yang akan dilihat oleh pengguna</li>
                        <li>Mengolah data, seperti Filtering, Searching, DLL</li>
                        <li>Membuat CRUD sederhana</li>
                    </ul>
                </div>

                
            </div>
        </Container>
    </div>
  );
}

export default Header;
